oxy_webhelp_navlinks = {"sec_encryp_doc_t-d4800e7420":{"topics":[{"title":"Accepting and deleting secret encryption keys","href":"sec_encryp_doc_accdel_t.html","attributes":{"data-id":"sec_encryp_doc_accdel_t"},"menu":{"hasChildren":false},"tocID":"sec_encryp_doc_accdel_t-d4800e7433","topics":[]},{"title":"To export a secret encryption key","shortdesc":"<p class=\"shortdesc\">If you want to give a secret encryption key to someone who does not use HCL NotesÂ® mail, you can export the key to removable media or to a shared file system, so that person can then import the secret encryption key. You may also need to export a secret key if you want to send the key to a Notes user who uses Internet certificates for mail security and prefers to receive mail in MIME format. <\/p>","href":"sec_encryp_doc_exp_t.html","attributes":{"data-id":"sec_encryp_doc_exp_t"},"menu":{"hasChildren":false},"tocID":"sec_encryp_doc_exp_t-d4800e7443","topics":[]},{"title":"To import a secret encryption key","shortdesc":"<p class=\"shortdesc\">If someone exported a secret encryption key for you to use, you must import the key into your User ID in order to use the secret encryption key.<\/p>","href":"sec_encryp_doc_imp_t.html","attributes":{"data-id":"sec_encryp_doc_imp_t"},"menu":{"hasChildren":false},"tocID":"sec_encryp_doc_imp_t-d4800e7462","topics":[]},{"title":"Secret encryption key advanced details","shortdesc":"<p class=\"shortdesc\">You can view all details about a selected secret encryption key in your User ID.<\/p>","href":"sec_keys_advdetails_c.html","attributes":{"data-id":"sec_keys_advdetails_c"},"menu":{"hasChildren":false},"tocID":"sec_keys_advdetails_c-d4800e7475","topics":[]}]}};